import Home from '~/Page/Home';
import Following from '~/Page/Following';

const publicRoutes = [
  { path: '/', component: Home },
  { path: '/Following', component: Following },
];
const privateRoutes = [
  { path: '/', component: Home },
  { path: '/Following', component: Following },
];

export { publicRoutes, privateRoutes };
